import React from "react";
import { IoReturnUpBack } from "react-icons/io5";

const ButtonBack = (onClick = null) => {
    return (
        <button className="screen__buttons backButton" onClick={() => onClick}>
            <IoReturnUpBack />
        </button>
    );
};

export default ButtonBack;
